一番単純な使い方としては

src/main/protobuf/ のディレクトリ以下に.protoの拡張子のファイルを置く
その後sbtでcompileをするだけで、sbtが管理するディレクトリに自動でScalaコードが生成されるため、それを使ったコードを書く

という手順です。
"sbtが管理するディレクトリ"とは、具体的にはtarget/scala-2.11/src_managed/main/
などです。
他の大抵のコード生成系のsbt pluginに共通することですが、このディレクトリはsbtが完全に自動で管理するものなので、
このディレクトリ以下のScalaファイルを直接編集することは想定されていません。
編集したとしても、生成元の.protoファイルを編集してコンパイルをやり直すと、編集内容が上書きされます。
